        "uid": "DscwWHzbAyb3UNaK9rjz",
        "description": "Curious what it takes to actually be radically inclusive? Feeling like Burning Man and default world have too much racism, sexism,homophobia, transphobia, ableism, ageism, classism, and oppression then the magical world you want to live in? Then this workshop is for you!\r\n \r\nIn a fun, creative, interactive way, we are gonna get serious about our collective liberation and what it really takes to make the world a better place. Join us as we dive deep on this facilitated journey of learning tools to deconstruct the current painful and harmful system we live in and rebuild the world we want to see.  This workshop will give you tools to end oppression, pathways to personal and political liberation, and will be rooted in the theme of ritual and will have a liberation ritual component.\r\n \r\nAll genders and backgrounds welcome always!",
