        "uid": "DY9TiPYN7yZCutXScKPN",
        "description": "\"What women need, that men don't need, to fully activate sexually. Informational/experiential workshop for couples with at least one female!\r\n\r\nInspired by Naomi Wolf's Vagina (her book, not the real thing). So if no-one's told you, or you haven't noticed yet, men and women are different! Just how different, particularly in sexual response, is only recently being discovered by western science. The famous study of sexuality in the swinging sixties by Masters and Johnson was largely about male sexuality and in a stunning failure of the scientific method they kinda assumed women were pretty much the same......\"\"two arms, two legs, a head, yeah, I think they're pretty much going to react the same way....\"\" without actually finding out until 50/60 years later!\r\n\r\nBut there are and have been more enlightened cultures than ours on these matters. It turns out that some eastern cultures had got a very detailed handle on female sexuality thousands of years ago. Ancient tantric teachings turn out to be not a set of arcane practises based on spiritual mumbo jumbo but precise systems of activating the fullness of the feminine sexual response, now being verified by the latest research in neuroscience in the west.\r\n\r\nWolf calls this range of specific stimulations the Goddess Array, and I shall attempt to describe the steps that every woman needs that men don't need and create a container for you to experience the majority of them in one of Naked Heart's carpeted domes. \r\n\r\nPlease bring nesting materials and a secret gift for your goddess.",
