        "description": "You are invited to join Red Lightning and First Nations as we sit together under the Medicine Wheel and close our Radical Ritual with the extinguishing of the Sacred Fire.\r\n\r\nOur life is a ceremony.  And this year, we gathered to ceremonially engage in a Radical Ritual together on the dusty Playa land. The extinguishing of this Sacred Fire marks the closing of our week-long ceremony at Burning Man. \r\n\r\nHow have you learned to appreciate fire during our ceremony together? \r\nHow have you learned to work with the spirit of the fire?\r\nHow will you carry this prayer forward, and back to your communities? How will you keep your own Sacred Fire lit? How will you continue to shine your light in the darkness?\r\n\r\nFire feeds the seeds of intention of what we seek to call forth. Fire is also a purifier. Send everything that no longer serves you into your own Sacred Fire to purify your heart, body, mind, and soul.  Keep the memory of what occurred this year during our Radical Ritual with you, and bring it back to your community.",
