        "title": "Balance of Safety & Aliveness",
        "uid": "uPFz6Grc7x6azmePt3Nh",
        "description": "\"How does one assess and honor their boundaries, yet still have the ability to stretch outside their comfort zone to grow beyond fears in intimate relating? \r\nThere is a delicate balance between taking too big of a risk and acting out of integrity, versus hiding in comfort and playing it too safe. How do you balance your need for safety with your yearning for full expression? \r\nHow do you identify your growth edge, play safe but not too safe, and keep riding that edge, take risks but not into the danger zone? Can you find the sweet spot of feeling safely embodied while growing and  expanding towards what you want? Join us for this energizing, exciting, connecting and possibly edgy exploration. Lets move through the unknown of relating into the sweet spot of living an exhilarating life while still having your own back. \"",
