        "description": "A chickenwire gallery dedicated to gifting small pieces of wayward art to participants, the Home for Wayward Art finds homes for Lost Art, Found Art, Bad Art, and Art which Needs a Loving Hug.  Participants choose a piece of art which speaks to them, fill out a short adoption card, and take the art home with them to keep.  Small paintings, prints, photography, and collages are the usual mediums, much is original work, it is hard to tell what you will find.  A Gifting Box is available for your perusal, and has swag, trinkets, and small useful items.\r\nOpen during daytime hours.  The Home is curated each morning, so every day there is something new.  Hours are after coffee until suppertime.  Closed in case of rain or wild stampedes.\r\nDonations of non-MOOPY art are welcome, but please, no food or costumes or anything large which would be hard to transport.",
