        "event_id": 23176,
        "title": "Transfoamation",
        "uid": "PaFRfaEpjoiThdHm5LsF",
        "description": "Transfoamation is an interactive perfoamance camp which prompts citizens of BRC to ponder self-awareness and investigate the sources of their identity through the examination of perspectives on gender, sociofomo status, race and privilege.  Set in a post Refoamation environment, our theme from last year which asked people to confess their environmental sins to animals and experience life behind bars, this year\u2019s Transfoamation involves a multi-stage process developed in conjunction with LGTBQ community which will highlight person-to-personal exercises diving into identity as participants queue up. After completing all prefoamation rituals to join our Tranfoamation they will shed their old dusty selves and clothing, enter our transfoam chamber, and ascend to the final stage of their actual Transfoamation to oneness with the universe and their fellow human in the transblastive foam experience. \r\n\r\nTransfoamation will take place daily starting on Wednesday and ending on Saturday at 12:00 -1:00pm for children under 13, 1:00 - 4:20pm for all people of all ages. We are usually located near 2:15/G. \r\n\r\nTransfoamation is also the home base of an amazing community that services the city 24 hours a day in a number of ways.  Besides the wonder of a daily personal Transfoamation we offer, the camp serves as the home base of the volunteer professionals working with the Zendo project that provides psychological harm reduction services across the BRC.  We host trainings for Zendo staff in our camp and run a 400 plate per meal kitchen connected to the Transfoamation and Zendo.  We will have a midday hydration area at the exit of our Transfoam Dome run by our camp as well. Also part of the Transfoam camp is the Abraxas Mutant vehicle team.\r\n\r\nOur camp changes it's name every year. Previous years we have been called Refoamation, Something Freaky This Way Foams, Fauxmirage, UFOm, Faux Mitzvah, Foamo Aragato, and Foam Saves.",
