        "description": "The Painting Wall of Peace Evolves needs you! Help create an ever changing wall of artistic expression which will bring beauty and inspiration to the people of the playa. \r\nThe wall is a 24 foot long 4 foot high blank canvas which is comprised of 8 interlocking 4' x 3' canvases. It will be primed and ready for you to get your art on! As the week goes by the wall will evolve into a community mural for the citizens by the citizens! \r\nAll individuals, whether master artists or stick figure lovers, are invited to participate. Paint as much as you like or observe from our viewing bench.\r\nWe will supply all brushes and paint for the wall. Basic painting instruction will be provided if requested. Music will be playing from behind the wall so you can dance along with the colors as you choose. Lights will be on for evening viewing (or painting if we stay open late). The wall will be open for creativity Monday - Friday 10am and stay open until 6pm (or later).\r\n\r\nOn Saturday the wall will be dismantled. Each of the 8 individual canvases which comprised the wall will be randomly gifted to citizens of the community. These amazing gifts will hold the work of hundreds of passing artists creating magic memories of BRC 2017!",
