        "title": "Your ASIS is awesome!",
        "uid": "K43s8dTHasb2wP772HUR",
        "description": "The Playa ASIS Project is a photo essay. Born literally from a dream after returning from Burning Man about ten years ago, my vision embraced the core of the human body - the Anterior Superior Iliac Spine and the visible line of the Inguinal Ligament. A dream of dancers, hoopers, fire spinners and burners moving in every manner of human endeavor on the Playa and always the ASIS supporting the human form with such graceful, sensual strength. The Playa ASIS Project will attempt to capture the absolutely unique core of the individual in context of the Burning Man experience. This is not genital photography and we will limit identifying markers to your ASIS. Final artistic discretion will remain with the photographer.\r\nThis ASIS project will have a stationary location in our camp's community monkeyhut space on Tues. and Thurs. from 12pm to 2pm, but will also be roaming the playa with a photo wagon Mon., Wed. and Fri. Photos taken will be used for a anonymous encyclopedia of playa ASIS. Subjects will only be photographed if they choose to be part of the project. No records are kept on participants making the photos essentially anonymous.",
