        "uid": "PUK9K8c6TeDpBVREGgNi",
        "description": "Join Camp Feel Good for a guided creative visualization meditation. Dr. Feelgood will help you picture your perfect day 10 years in your future. The process works by subconsciously shifting your decision making over the next 10 years eventually making your vision a reality. You don't know what that day looks like? Don't worry, most people don't, but your subconscious already knows what is important to get there. The more amazing and compelling the vision that you let emerge, the more you will be drawn to it. How? Most people make between 80 to 400 decisions a day. A rich, compelling visualization with a lot of sensory \"hooks\" can shift those decisions towards your perfect future because the right choices will feel \"good.\u201d We will start with a mindfulness of breath meditation, a gratitude exercise and then wake up the morning of your perfect day and explore it through a guided process. After, we will ask a few of those interested to share their visualization with the group. We look forward to sharing your future day together. Dr. Feelgood.\r\n\r\n\r\nThe 45 Minute Meditation Session is 2PM M-F and followed up with creative cocktails, step up and have a feel good drink at our Camp Feel Good Compliment Bar/Sherpa Foot washing station!\r\n\r\nFor those in need of a deep dive in what you want out of life, we offer an Advice Booth Open every day!",
