        "description": "Recent advances in psychedelic science are poised to fundamentally change our approach to mental health and human wellness.  I\u2019ll present the latest in research from NYU and the growing field of research with psychedelic plants and medicines.  Then I\u2019ll present results from our study of psilocybin-assisted psychotherapy for clinical anxiety and distress among cancer patients, which was featured on the front page of the New York Times.  The findings suggest that a single-dose of psilocybin produced rapid and robust anxiolytic and anti-depressant effects, with large magnitude between-group effect sizes at six weeks.  These large reductions in anxiety and depression were sustained at 8 months follow-up.  \r\n\r\nWe might ask: how does a single dose of this medicine work to effect such profound changes?  To answer this question, I conducted in-depth interviews with our cancer patients.  In their own words, patients describe profound shifts in their physical experience of their bodies, striking changes in their attachments and relationships with loved ones, and catharses of strong emotions, even difficult struggles, which were resolved with the help of the therapy team and the supportive container.  These interviews help us open the \u201cblack box\u201d of psychedelics and explain how such clinical changes are possible.  I will provide a critique of the hypothesis that a single mediator\u2014a traditional \u201cmystical experience\u201d\u2014can account for the complex terrain of psychedelic-assisted practices. Finally, I\u2019ll review the \u201croots and fruits\u201d of alleged mystical experience.  In a study at the University of Pennsylvania, we empirically tested the assertion that drug-induced mystical experiences were \u201cinauthentic\u201d or different in kind from spontaneous mystical experiences.  The emergence of a psychedelic practice in contemporary medicine and culture raises boundary-crossing questions about the nature of knowledge and human experience: just where does science leave off and the mystical begin?",
        "event_type": {
            "id": 3,
            "label": "Class/Workshop",
            "abbr": "work"
        },
        "year": 2017,
        "print_description": "Presentation of research with psilocybin to treat cancer anxiety, depression, addiction, and to generate mystical experiences in religious leaders.",
        "slug": "frontiers-of-psychedelic-medicine-with-alex-belser",
