        "uid": "ZKZU5Ln22soYk8d6vKkn",
        "description": "Partnered breathing meditation focused on generating intimacy, emotional openness, and physical bonding in a safe, guided, non-sexual way.\r\n\r\n\"Belly2Belly partnered breathing meditation is a deceptively simple process that rests on multiple dimensions of neurobiology, pranayama, focused sensory awareness, tantric ritual, intimate communion, witness consciousness, sound entrainment, sequenced relaxation, psychological regression, shadow work, neurolinguistic programming, wizardry and primate zoology.\r\n\r\nThe exercises are designed to dissolve the Western experience of separate self into rhythmic waves of sensation and feeling that are shared with a partner in real time.\r\n\r\nWhat results is a profoundly felt sense of peace and connection, a natural biochemical high that neuro-mirrors intimate love, meditative samadhi and mystical oneness.\r\n\r\nThe Belly2Belly practices were developed by David Cates in his healing work with sexual trauma. The results were so  potent that David adapted many of the exercises to share in groups.\r\n\r\nIn groups, we focus on generating intimacy, emotional openness, and physical bonding in a safe, slow, guided non-sexual way. We reawaken our primal need for human connection, animal to animal, body to body, heart to heart, without the stress or uncertainty of sex. By trusting our bodies and each other, we reclaim our original innocence... and remember we are safe.\"",
